export const ARTOCOIN_CREST_PNG_DATA_URL = `data:image/png;base64,${ARTOCOIN_CREST_PNG_BASE64}` as const;

function decodeBase64ToBinary(base64: string): Uint8Array {
  if (typeof atob === 'function') {
    const binary = atob(base64);
    const length = binary.length;
    const bytes = new Uint8Array(length);
    for (let index = 0; index < length; index += 1) {
      bytes[index] = binary.charCodeAt(index);
    }
    return bytes;
  }
  if (typeof Buffer === 'function') {
    return Uint8Array.from(Buffer.from(base64, 'base64'));
  }
  throw new Error('No base64 decoder available in this environment.');
}

export function createArtocoinObjectUrl(): string {
  const bytes = decodeBase64ToBinary(ARTOCOIN_CREST_PNG_BASE64);
  const blob = new Blob([bytes], { type: 'image/png' });
  return URL.createObjectURL(blob);
}

export function revokeArtocoinObjectUrl(url: string): void {
  URL.revokeObjectURL(url);
}
